import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, TextInput, Button } from 'react-native';

export default function Home() {
    return (
        <View>
            <View>
                <Button
                    title="LogIn"
                    color="#f194ff"
                    onPress={() => Alert.alert('Not Yet Implemmented!')}
                />
            </View>
            <View>
                <Button
                    title="Register"
                    color="#f194ff"
                    onPress={() => Alert.alert('Not Yet Implemmented!')}
                />
            </View>
        </View>
    );
}
